.contain {
  width: 86% !important;
  margin: 0 auto !important;
}

@keyframes opening {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

.navbar_fixed {
  position: fixed;
  width: 100%;
  top: -1px;
  left: 0;
  right: 0;
  background: #fff;
  opacity: 0.9;
  box-shadow: 0px 10px 30px rgba(118, 85, 225, 0.3);
